import {React,  useState } from "react";
import { useNavigate, useOutletContext ,Link } from "react-router-dom";
import "../style/login.css";
import { auth } from "../services/firebase";
import { getDatabase, ref, get } from "firebase/database";
import { signInWithEmailAndPassword, GoogleAuthProvider, signInWithPopup, browserLocalPersistence, setPersistence,  fetchSignInMethodsForEmail,   linkWithCredential } from "firebase/auth";
import { LoginPopup } from "../modal/LoginPopup";


function Login() {
   const navigate = useNavigate();

  // Local state for popup
  const [popupMessage, setPopupMessage] = useState("");
  const [popupType, setPopupType] = useState(""); // "success" or "error"

  const showPopup = (msg, type) => {
    setPopupMessage(msg);
    setPopupType(type);
    setTimeout(() => setPopupMessage(""), 2000);
  };

  // ðŸ”¹ Email/Password login with Firebase Auth
  const handleLogin = async (e) => {
    e.preventDefault();
    const email = e.target.email.value.trim();
    const password = e.target.password.value.trim();

    try {
      await setPersistence(auth, browserLocalPersistence);
      await signInWithEmailAndPassword(auth, email, password);

      // Save session manually if needed
      localStorage.setItem("session", JSON.stringify({ email, timestamp: Date.now() }));

      showPopup("Login successful!", "success");
      setTimeout(() => navigate("/dashboard"), 1000);
    } catch (error) {
      console.error(error);
      showPopup("Invalid email or password.", "error");
      e.target.password.value = "";
    }
  };

  // ðŸ”¹ Google login with Firebase Auth
  const handleGoogleLogin = async () => {
    const provider = new GoogleAuthProvider();

    try {
      await setPersistence(auth, browserLocalPersistence);
      const result = await signInWithPopup(auth, provider);
      const user = result.user;

      showPopup("Login successful!", "success");
      localStorage.setItem("session", JSON.stringify({ email: user.email, timestamp: Date.now() }));
      setTimeout(() => navigate("/dashboard"), 1000);
    } catch (error) {
      console.error(error);
      showPopup("Google login failed: " + error.message, "error");
    }
  };

  return (
    <div className="login-container">
      {/* LoginPopup mounted here */}
      <LoginPopup message={popupMessage} type={popupType} onClose={() => setPopupMessage("")} />

      <div className="card">
        <div className="text-center mb-3">
          <img src="/images/laundrylogo.jpg" alt="Logo" className="img-fluid" />
        </div>

        <h3 className="text-center">Welcome to Lola Fe's Laundry PH</h3>
        <p className="text-center">Sign in to continue</p>

        <button className="btn-google" onClick={handleGoogleLogin}>
          <img src="https://www.gstatic.com/firebasejs/ui/2.0.0/images/auth/google.svg" alt="Google Logo" />
          Continue with Google
        </button>

        <div className="d-flex align-items-center">
          <hr className="divider flex-grow-1" />
          <span className="divider-text">OR</span>
          <hr className="divider flex-grow-1" />
        </div>

        <form onSubmit={handleLogin}>
          <div className="mb-3 text-start">
            <label htmlFor="email" className="form-label">Email</label>
            <input type="email" id="email" className="form-control" placeholder="you@example.com" required />
          </div>

          <div className="mb-3 text-start">
            <label htmlFor="password" className="form-label">Password</label>
            <input type="password" id="password" className="form-control" placeholder="********" required />
          </div>

          <button type="submit" className="btn-primary">Sign in</button>
        </form>

        <div className="footer-links mt-4">
          <Link to="/signup">Sign up</Link>
        </div>
      </div>
    </div>
  );
}


export default Login;
